import { Language } from "@material-ui/icons"

const Languages = [
    {
        'id':1,
        'name':'English',
        'symbol':'en'
    },
    {
        'id':1,
        'name':'Amharic',
        'symbol':'am'
    },
    {
        'id':1,
        'name':'Oromiffa',
        'symbol':'om'
    },
    {
        'id':1,
        'name':'Tigrigna',
        'symbol':'tg'
    }
]

export default Languages
